import React from 'react'
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import { Grid } from '@mui/material';

export default function header() {
  return (
    <AppBar position="static">
        <Toolbar>
            <Grid container>
                <Grid item sm={4} md={6}>

                </Grid>
                <Grid item sm={8} md={6}>     

                </Grid>
            </Grid>
        </Toolbar>    
    </AppBar>
  )
}
